    constructor(props){
        super(props);
        eid=this.props.match.params.id;
        console.log(eid);
    }
    render() {
    return (<Router>
        <div class="home">
            <div class="nav">
            <ul>
                <li><a class="active" href="/"><img alt="sorry" height="120%" width="15%" src={pit}/></a></li>
                <li><a class="links" href="/login">LogOut</a></li>
                <li><a class="links" href="/donorprofile/:id">MyProfile</a></li>
            </ul>
            </div>

        </div>
        </Router>
    );
    }
}
